rage, and in home washer and dryer. Select homes offer vaulted ceilings and wood burning fireplaces. Our community has an outdoor swimming pool with sundeck, a fitness center, picnic and barbecue areas, on site recycling and walking and biking paths. We are located close to I 66, I 495 and the Fairfax County Parkway, and just steps from the Virginia Rail Express Station. We are 40 minutes from Washington DC, and 30 minutes from Dulles Airport. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Fairfax County Pkwy and Roberts Pkwy. From I 495  Exit at Braddock Road West. Turn left onto Burke Lake Road  just before Kings Park Shopping Center . Stay on Burke Lake Road for approximately 2 miles. Turn right onto Burke Centre Parkway. At the second stoplight  turn right onto Burke Commons Road. The entrance to Burke Shire Commons is on the right about.5 miles on Burke Commons Road.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"30.00", "Spaces"=>nil, "Comment"=>"Reserved parking for residents is available in our private parking lot. We also offer premier parking spaces for $50 a month."}, {"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"15.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAc