 "CloseTime"=>"05:00 PM", "Day"=>"Sa"}], "ShortDescription"=>"Pet friendly and smoke free apartments for independent seniors in Escondido, CA. Private patio or balcony, mountain views. Pool, spa, library, clubhouse and activities. Near recreation, shopping and dining. Guarantors welcome.", "LongDescription"=>"Heritage Park Escondido Apartments for 55  in Escondido, CA 92027 for independent seniors aged 55 or better, are pet friendly and smoke free apartment homes north of San Diego, near great recreation, shopping and dining.  Our apartment homes feature second floor vaulted ceilings, bright kitchen windows, ample closet space and private patios and balconies. Our community offers a year round heated swimming pool, spa, lending library with wide screen TV, a clubhouse, coffee bar and outside seating, plus monthly activities, on site recycling and 24 hour maintenance. Located near I 15 and Route 78, we are 10 minutes from Escondido proper, 40 minutes from San Diego and 45 minutes from the San Diego International Airport. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Valley Pkwy and Citrus Ave. From Highway 78 east or west  exit at Ash Street and turn left onto Valley Parkway. Continue past Vons and Ralphs andthe community is on the right.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"7.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot."}}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"