iling fans, plantation blinds, ample closet space and central A/C and heat. Select homes offer a private patio and washer/dryer connections. Our community offers an outdoor swimming pool, 2 playgrounds, a mini business center and a coffee bar. We are close to shopping, dining and entertainment, and just 3 miles from the James City/Williamsburg Community Center. We are just off of I 64 and RTE 199, 30 minutes from the Newport News/Williamsburg Airport, 25 minutes from Newport News, and 35 minutes from Hampton. Guarantors welcome!", "DrivingDirections"=>"Woods of Williamsburg Apartments Major Cross Streets  Longhill Rd and Tilghman Court. From I 64  Take Exit 234 A to Lightfoot. This puts you on 199 East. From 199 E  take the Longhill Road Exit  4th exit . Stay to the right and continue on Longhill Road for 1.5 miles. The Woods of Williamsburg sign will be on the right. Turn right onto Tilghman Court. Our Leasing Center sign is at the top of the hill  on the left. Our office is right across from the pool. Look for the flag poles and Welcome Center sign.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available in our private lot. One assigned parking space per home. Additional parking for guests and residents is available on a first-come, first-served basis. Parking permits are required."}}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, 