ommunity. Our luxury apartment homes feature stylish new interiors, including  energy saving kitchens, combo washer and dryer, wood style floors, crown molding, two tone paint, and new baths, windows and lighting. Kitchens have GE stainless steel appliances, granite countertops, and cherry or maple cabinets. Our community features a new fitness center, Wi Fi lounge, on site recycling and a rooftop sundeck with gorgeous city views. We are just steps from Whole Foods, several shops and restaurants and two metro stops, Latrobe is in the center of it all. Our pet friendly community also offers assigned garage parking. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Rhode Island Ave and 15th St The Latrobe is in downtown DC  at the nexus of Dupont Circle and Logan Circle. Our community is located at 1325 15th Street  NW.From Virginia  take I 395 North over the 14th Street Bridge into DC. Follow 14th Street  make a left onto Rhode Island Avenue. Drive 1 block  then turn right on 15th Street. The Latrobe will be on your right.From Maryland  take the beltway to the Georgia Avenue exit heading south. Bear right on 16th Street  then take 16th Street to P Street. Turn left on P Street and continue for 2 blocks. Turn right on 14th Street  then turn right on Rhode Island Avenue. Continue for 1 block  then turn right on 15th Street. The Latrobe will be on your right.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"225.00", "Spaces"=>nil, "Comment"=>"Assigned parking for residents is available in our private parking lot."}, {"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"275.00", "Spaces"=>nil, "Comment"=>"Assigned underground garage parking options are available for residents."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"