ch Gardens, the Pepsi Center and Sports Authority Field at Mile High are less than 10 minutes away. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  On 17th St between Stout St and Champa St.  I 70 West  Take Brighton Blvd CO 265  Exit 275B . Turn left on CO 265 S Brighton Blvd. Brighton Blvd becomes Broadway. Turn slight right onto Champa. Turn left on 17th. We are between Stout and Champa on 17th. I 70 East  Take Brighton Blvd CO 265  Exit 275B . Turn right onto CO 265 S Brighton Blvd. Brighton Blvd becomes Broadway.Turn slight right onto Champa. Turn left on 17th. We are between Stout and Champa on 17th. I 25  Take the Auraria Parkway  Exit 210C . Stay straight to Auraria Parkway. Turn right onto Speer Blvd. Turn left on Lawrence. Turn right onto 17th. We are between Stout and Champa on 17th.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>{"type"=>"street", "Assigned"=>"1", "Spaces"=>nil, "Comment"=>"No on-site parking. Nearby parking options include Central Parking (303-893-9802), Ampco Parking (303-573-8121), LAZ Parking (303-572-6680), Republic Parking (800-758-5378), Standard Parking (303-892-5812) and Star Parking (303-623-2433)."}}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriod"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAR"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAP"=>{"year"=>"0", "day"=>"0