 Guarantors welcome.", "LongDescription"=>"Bay Parc Plaza Apartments in Miami, FL 33132 is a smoke free community. Many apartments have washers/dryers, GE energy saving appliances, breakfast bars and spacious closets. Private patios/balconies, hardwood floors, granite countertops and updated lighting.  Gated, pet friendly community features a swimming pool, two Jacuzzis, fitness center, and a half basketball court.  24 hour game room with big screen movie viewing area, valet service, 24 hour concierge, convenience store, on site recycling and pet store.  We are 10 minutes from Miami Beach and less than 15 minutes from Miami International Airport.  Located near I 95 and less than 1 mile from Omni International Mall of Miami.  Guarantors welcome!", "DrivingDirections"=>"Major Cross Roads  Biscayne Blvd and Venetian Causeway.  From I 95 North  Drive East towards the beach and take the Biscayne Blvd exit. Turn right at the light heading southbound. Travel less than 3 miles and turn left on NE 15th Street going east. Make a left turn onto N Bayshore Drive travel North past NE 17th Court and Bay Parc Plaza is across from Margaret Pace Park on the left side of N Bayshore Dr. From I 95 South  Go Northbound to I 395 East towards the beach. Take the Biscayne Blvd exit  and turn left at the traffic light. Head North on Biscayne Blvd and travel less than 1 mile to NE 15th St. Turn right on NE 15th St Court  and make a left turn onto N. Bayshore Dr. Drive North past NE 17th Court where Margaret Pace Park is located. Bay Parc Plaza is directly across from Margaret Pace Park on the West side of N Bayshore Dr.", "LeaseLength"=>"We offer 7-18 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"120.00", "Spaces"=>nil, "Comment"=>"Covered garage parking options are available for residents.  $120 for Permit 1, $120 for Permit 2, $145 for Tandem Parking and $145 for tandem Premier Parking. Also have motorcycle parking for $45."}, {"type"=