dryers and 9 ft. ceilings. Our clubhouse features a fully equipped fitness center, library, game room and media room. A pet friendly and smoke free community with lighted tennis courts, putting green, natural fishing pond, jogging path, and remodeled pool. Easy access to I 95, just 10 miles from Brown University and 2 miles from Warwick Shopping Center. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Centerville Rd and Bald Hill Rd. From I 95 North  Take Exit 10. Go through 2 traffic lights that are very close together. Royal Crest Warwick is on the left hand side shortly after the 2nd light. Follow signs to the Rental Office. From I 95 South  Take Exit 10B. Go through 2 traffic lights that are very close together. Royal Crest Warwick is on the left hand side shortly after the 2nd light. Follow signs to the Rental Office.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot."}, {"type"=>"none", "Assigned"=>"1", "SpaceFee"=>"35.00", "Spaces"=>nil, "Comment"=>"Reserved parking for residents is available in our private parking lot."}, {"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"195.00", "Spaces"=>nil, "Comment"=>"Covered garage parking options are available for residents. Availability is limited. "}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"