ype"=>"apartment", "PrimaryID"=>"042467", "SecondaryID"=>"028423", "General_ID"=>{"ID"=>"http://www.islandclubapartmenthomes.com/apartments/floorplan.do", "Description"=>nil}, "MarketingName"=>"Island Club Apartments", "OwnerLegalName"=>"OP Property Management, LP", "Address"=>{"Address1"=>"2300 Catalina Cir ", "City"=>"Oceanside", "State"=>"CA", "Zip"=>"92056", "Country"=>"USA", "PO_Box"=>nil, "MailingAddress"=>nil, "ShippingAddress"=>nil}, "MSA_Name"=>"41740-San Diego-Carlsba", "Latitude"=>"33.219416", "Longitude"=>"-117.263973", "WebSite"=>"http://www.islandclubapartmenthomes.com", "Phone"=>{"Number"=>nil}, "Email"=>"042467@aimco.com"}, "Information"=>{"StructureType"=>"unspecified", "UnitCount"=>"592", "YearBuilt"=>"1986", "StartRent"=>"1411.00", "OfficeHour"=>[{"OpenTime"=>"10:00 AM", "CloseTime"=>"05:00 PM", "Day"=>"Su"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"07:00 PM", "Day"=>"M"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"07:00 PM", "Day"=>"T"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"07:00 PM", "Day"=>"W"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"07:00 PM", "Day"=>"Th"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"07:00 PM", "Day"=>"F"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"05:00 PM", "Day"=>"Sa"}], "ShortDescription"=>"Apartments in Oceanside, CA with private patios/balconies and energy efficient GE appliances. Refinished cabinets and countertops, hardwood floors, storage closets, washers/dryers, walk in closets and vaulted ceilings. Pet friendly, smoke free community with three swimming pools and spas, fitness center and car wash bay. Guarantors welcome.", "LongDescription"=>"Island Club Apartments in Oceanside, CA 92056 is right off Route 78, near I 5 and I 15, less than 7 miles from the beach.  Apartments feature private patios/balconies, central heat and air, hardwood floors, electric kitchens, refinished cabinets and countertops, energy efficient GE appliances, ceiling fans and storage closets.  Select apartment homes have a pool view, washer/dryer, fireplace, walk in closet, pantry, linen closet and vaulted ceilings.  Pet friendly, smoke free community with three swimming pools and spas, fitness center, assigned carports, on site recycling and three laundry facilities.  Located 48 miles from San Diego, 20 minutes from Camp Pendleton and across the street from a SPRINTER station.  Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Oceanside Blvd and Melrose Dr.  From I 5 South  take the exit for Oceanside Boulevard. Turn left on Oceanside. We are 5.5 miles up the road on the left hand side. From I 5 North  take the exit for Route 78 East toward Escondido. After about 3 miles  take the College Boulevard exit. Turn left on College Boulevard and continue for 2 miles  then turn right onto Oceanside Boulevard. We are 1.5 miles up the road on the left hand side. From I 15  take the Route 76 exit toward Pala Oceanside. Turn right on Pala Road Route 76 and continue for about 10 miles. Turn left on North Santa Fe Avenue  Guajome County Park will be on your left . After about 1.5 miles  turn right on Melrose Drive. After a little more than 1 mile  turn right on Oceanside Boulevard. We are less thanhalf amile up the road on the right hand side.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"covered lot", "Assigned"=>"1", "SpaceFee"=>"20.00", "Spaces"=>nil, "Comment"=>"Covered carport parking options are available for residents."}, {"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available in our private parking lot."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "d