ents and  townhomes are beautifully appointed with spacious living areas, washer/dryer and a private patio or balcony. Remodeled homes feature gourmet kitchens with ceramic tile flooring, marble style countertops, cherry wood cabinets, private balconies and stainless steel appliances. Townhomes feature granite countertops, stainless steel appliances, wood flooring and private garages. Our pet friendly, controlled access community includes amenities such as a year round pool and Jacuzzi spa, sauna, new 24 hour fitness center and dog park. We also offer garage parking, car wash, concierge service, a convenience store, on site recycling and a business center. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  York Rd and Butterfield Rd. From Chicago  take I 290 West to 38 West  Roosevelt Rd . Take the Butterfield exit and turn right at the stop sign. Turn onto the Frontage Road  then take the next left turn  which is Atrium Way  Elm Creek Dr . Follow the Elm Creek signs. From Route 83  take the exit for Route 56  Butterfield Rd  east. Continue for.5 miles  then turn right on Commonwealth Lane. Follow the curve in the road  then turn left on Atrium Way  Elm Creek Dr . Follow the Elm Creek signs. From the West suburbs  take I 88 east to Midwest Road. Turn right  north  on Midwest Road. At the second stoplight  turn right onto Butterfield Road. After you pass Roosevelt Road  turn right on Commonwealth Lane. Follow the curve in the road  then turn left on Atrium Way  Elm Creek Drive . Follow the Elm Creek signs.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot. "}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"40.00", "Spaces"=>nil, "Comment"=>"Reserved parking for residents is available in our private parking lot."}, {"type"=>"garage lot", "A