 Pkwy SE  right at the top of the hill onto Mt Wilkerson Pkwy SE.Located at the bottom of the hill. From the South   Take I 285 N to Exit 18  Paces Ferry Rd toward Vinings . Keep right at fork  follow signs for Cumberland Pkwy S. Merge onto Paces Ferry Rd SE  pass Starbucks on right . Turn left at the Quick Trip  on right  onto Overlook Pkwy SE and right at top of the hill onto Mt. Wilkerson Pkwy SE. Located at the bottom of the hill. ", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"125.00", "Spaces"=>nil, "Comment"=>"Full-sized garages are located at Lakeside and Peak and can be used by Views residents as well. "}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"25.00", "Spaces"=>nil, "Comment"=>"Reserved spaces are available in our uncovered lot. Permit required."}, {"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot. Permit required."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriod"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAR"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAP"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "TaxCredit"=>" "}, "Payment"=>{"RemitTo"=>{"Address1"=>nil, "Address2"=>nil, "City"=>nil, "State"=>nil, "Province"=>