, {"OpenTime"=>"09:00 AM", "CloseTime"=>"05:00 PM", "Day"=>"Sa"}], "ShortDescription"=>"Large, smoke free apartments in Nashua, New Hampshire with a patio or balcony, washer/dryer and built in wine rack. Amenities include a fitness center, pool, sauna, tennis and volleyball courts and controlled access entry. Near Everett Turnpike  Route 3 . Guarantors welcome.", "LongDescription"=>"Bay Ridge at Nashua Apartments in Nashua, NH feature a private patio/balcony, washer/dryer, ceiling fan and built in wine rack.  Select apartment homes offer walk in closets, new kitchen appliances and separate dining areas.  Our pet friendly and smoke free community with fitness center, sauna, swimming pool, clubhouse with free Wi Fi, available carports, tennis and sand volleyball courts.  Every building has controlled access intercom entry.  Near Pheasant Lane Mall and Everett Turnpike  Route 3 . Guarantors welcome!", "DrivingDirections"=>"Our community is located at 25 Bay Ridge Drive  which is right off Everett Turnpike  Route 3 . We are 1 mile from Royal Ridge Plaza  1.5miles from Southgate Plaza and 1.75 miles from Pheasant Lane Mall. Major Cross Streets  Spit Brook Rd and Route 3. From Route 495  Take North Everett Turnpike  Route 3  heading north and continue for about 9 miles  crossing from Massachusetts into New Hampshire . Take the exit for Spit Brook Road  exit 1 towards South Nashua . Turn left at the stoplight onto Spit Brook Road and go underneath the overpass. At the second set of lights  turn left onto Brook Village Road. Continue for about.3 miles  and you will see the Bay Ridge at Nashua sign on your right. Turn right onto Bay Ridge Drive and follow the outline of the pond until you reach the clubhouse on your right.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"15.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private p