t free membership to the Calhoun Beach Health Club, featuring indoor and outdoor swimming pools, yoga, pilates and dance classes, tennis, racquetball and squash courts. Swim, boat or enjoy the beach at Lake Calhoun, just across the street.  25 minutes from the airport. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Lake St and Excelsior Blvd. Just south of I 394 and west of I 35W in the Uptown Lake Area of Minneapolis  on the north shore of Lake Calhoun just south of the Lake of Isles and the Minneapolis Chain of Lakes Park. From West Minneapolis or Minnetonka From I 394 head south on Cedar Lake Ewing Ave S to Minnetonka Blvd. Turn east and continue to Lake Street. Follow Lake St east and pull up under the black awning. The complimentary valet will park your car for you. Enter the building and go to the end of the hallway toward the health club. Leasing staff will be there to assist you. From Downtown Minneapolis From 35W take the Lake Street exit. Follow Lake St west and pull up under the black awning. The complimentary valet will park your car for you. Enter the building and go to the end of the hallway toward the health club. Leasing staff will be there to assist you.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"130.00", "Spaces"=>nil, "Comment"=>"Covered garage parking options are available for residents. Prices range from $75-$155 depending on location and car type. Motorcycle parking is available for $50. "}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"175.00", "Spaces"=>nil, "Comment"=>"Reserved spaces available in the garage. "}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "La