ver Road. After 2 miles  look for Edgewater Commons Shopping Center on your left  Target and Barnes  amp  Noble . We are located on the left just past the shopping center.From the Lincoln Tunnel   Take exit for JFK Boulevard East. Proceed north on JFK Boulevard East for approximately 2 miles. Turn right onto Hillside Ave.  opposite 60th St. . At the next light  turn left onto River Road. Follow River Rd for 1 mile  take a sharp right turn after Independence Harbor. We are located between Independence Harbor and Edgewater Commons Shopping Center.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"100.00", "Spaces"=>nil, "Comment"=>"Underground garage parking options are available for residents. "}, {"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"85.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot. "}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriod"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAR"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAP"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "TaxCredit"=>" "}, "Payment"=>{"RemitTo"=>{"Address1"=>nil, "Address2"=>nil, "City"=>nil, "State"=>nil, "Province"=>nil, "Zip"=>nil, "Country"=>nil}, "CheckPayable"=>"https://property.onesite.realpage.com/we