re fully equipped with GE kitchens and private patios. Most homes features washers/dryers, large closets, private entries and extra storage space. Gated, pet friendly, and smoke free community with 24 hour fitness center, swimming pool, and complimentary Wi Fi in the clubhouse. Guarantors welcome.", "LongDescription"=>"Meadow Creek Apartments in Boulder, CO 80301 is less than 20 minutes from downtown Boulder and the University of Colorado. Our community is smoke free.  Our apartments have private patios, fully equipped GE kitchens and spacious closets.  Most apartment homes have washers and dryers, private entrances and additional storage space.  Gated, pet friendly community has 24 hour fitness center, swimming pool, sand volleyball court, playground, on site recycling and clubhouse with coffee bar and complimentary Wi Fi.  Located near the Boulder Reservoir, one mile from Highway 119 and a short walk to the bus stop and local shopping and dining. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Diagonal Hwy and 63rd St.  From Denver  Take Hwy 36 Boulder Turnpike to Foothill Parkway in Boulder. Follow Foothill to the end  veering right onto Hwy 119  Diagonal Highway . Follow Diagonal Highway toward Longmont  to the 63rd Street exit  and go right. Go two blocks to Spine Road and turn left. Meadow Creek is up about 1.5blocks. From Boulder  Take Foothill Parkway North all to the end  veering right onto Hwy 119  Diagonal Highway . Follow toward Longmont to the 63rd Street exit  and go right. Go two blocks to Spine Road and turn left. Follow Spine about 1.5 blocks to our property. From Longmont  Take Hwy 119 toward Boulder. Take the 63rd Street exit  go left to the second stop light  which is Spine Rd. Turn left onto Spine. Go 1.5 blocks to our property.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available