oseTime"=>"05:00 PM", "Day"=>"Sa"}], "ShortDescription"=>"Independent senior living at a soon to besmoke free community in Anaheim, CA. Private balconies and patios with storage, 24 hour maintenance, courtesy patrol and weekly resident activities. Within walking distance of banks, pharmacies and the post office. Guarantors welcome.", "LongDescription"=>"Heritage Village Anaheim Senior in Anaheim, CA 92805 offers independent living options for residents aged 55 . Just minutes from the 5, 57, 91 and 22 freeways. Pet friendly senior apartment homes is a community featuring large private patios and balconies with private storage, 24 hour maintenance, free coffee and snacks, and courtesy patrol. Our community is transitioning to be smoke free. The smoke  free transition process will be completed no later than September 1, 2017. Weekly resident activities in the clubhouse; plus a business center and lending library. Within walking distance of pharmacies, banking and the post office. We are close to Anaheim Police Department, Disneyland and the senior programs at the Downtown Community Center. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  W Lincoln Ave and S Harbor Blvd. From 91 E or 91 W  Exit at Harbor Blvd and head south for 4 miles. You will pass a major intersection at Harbor and Broadway. The next intersection is Harbor and West Santa Ana Street. Make a right on West Santa Ana Street. From 5 E or 5 W  Exit at Harbor Blvd and head north for 1 mile. Take a left on West Santa Ana Street.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"0.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot. Maximum 2 permits per home."}}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "