:00 AM", "CloseTime"=>"07:00 PM", "Day"=>"F"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"06:00 PM", "Day"=>"Sa"}], "ShortDescription"=>"Smoke free Miami Beach apartments with washers/dryers and designer kitchens. Most apartments have stainless steel appliances, granite countertops, tile or hardwood floors, large closets and private balconies. Pet friendly, gated community with two swimming pools and a Jacuzzi, updated fitness center, salon, valet and car detailing service. Guarantors welcome.", "LongDescription"=>"Flamingo South Beach Center Tower located in Miami Beach, FL is 10 minutes from downtown Miami and 20 minutes from Bal Harbor Shops.  Smoke free apartments feature washers and dryers, designer kitchens, stainless steel appliances, granite countertops, tile or hardwood floors, large closets and private balconies.  Gated, pet friendly community with two swimming pools and one Jacuzzi, basketball and beach volleyball courts, convenience store and cafe.  Updated fitness center, on site recycling, 24 hour valet and car detailing service.  Located 12 miles from Miami International Airport and easy access to I 395 and I 195. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Alton Rd and 15th St. From I 95 Going north or south  exit I 195 eastbound and follow to Alton Road. Veer right onto Alton Road and continue traveling southbound to 15th Street where you will find Einstein Bagels on the corner. Make a right on 15th Street and continue two blocks ahead where you will see Flamingo South Beach apartment homes. From I 395 Travel east on I 395 until it turns into MacArthur Causeway. Follow across the bay until you reach Alton Road  veer left to make a left turn onto Alton Road. At 15th Street  make a left just past Pollo Tropical Restaurant. Proceed two blocks to Bay Road where you ll turn left into the parking entrance on the right at Flamingo South Beach apartment homes.", "LeaseLength"=>"We offer 7-18 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"160.50", "Spaces"=>nil, "Comment"=>"One space can be rented per resident. Additional parking is available for scooters and motorcycles. Monthly rent does not include tax."}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"250.00", "Spaces"=>nil, "Comment"=>"VIP spaces are assigned, covered garage spaces conveniently located near the entrance to building. Valet parking is available per hour. 0-1 hour: $3, 1-5 hours: $6, 5-8 hours: $8, 8+ hours: $18. Guests with a guest resort pass may purchase a 14-day parking pass."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriod"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAR"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAP"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "TaxCredit"=>" "}, "Payment"=>{"RemitTo"=>{"Address1"=>nil, "Address2"=>nil, "City"=>nil, "State"=>nil, "Province"=>nil, "Zip"=>nil, "Country"=>nil}, "CheckPayable"=>"https://property.onesite.realpage.com/aimcoflamingocentertower"}, "Policy"=>{"Pet"=>[{"type"=>"Dog", "allowed"=>"true", "Comment"=>nil, "MaxCount"=>"2", "Fee"=>"500.00", "Rent"=>"50.00", "Weight"=>"300", "Restrictions"=>"Our pet-friendly apartments welcome most breeds of dogs. However, because certain dogs do not thrive in a community environment, we cannot accommodate the following breeds, dogs resembling these breeds, or mixes of these bre