rship. Major Cross Streets  Ogden Ave and Naper Blvd. From I 355  take the Ogden Ave US 34 exit and head West. Turn right on Fender Avenue  then turn right on Lake Trail Drive. From Butterfield Rd IL 56 W  turn left onto IL 53 S. Take the US 34 W ramp. Turn right on Fender Avenue  then turn right on Lake Trail Drive. Turn left to stay on Lake Trail Drive. From I 88 eastbound  take the Naperville Road exit. Turn right on Warrenville Road  then turn right on Naperville Road  then turn left on Ridgeland Avenue. Turn right on Fender Avenue  turn left on Lake Trail Drive  then turn left to stay on Lake Trail Drive.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot. "}, {"type"=>"none", "Assigned"=>"1", "SpaceFee"=>"40.00", "Spaces"=>nil, "Comment"=>"Premier parking for residents is available in our private parking lot."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriod"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAR"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriodAP"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "TaxCredit"=>" "}, "Payment"=>{"RemitTo"=>{"Address1"=>nil, "Address2"=>nil, "City"=>nil, "State"=>nil, "Province"=>nil, "Zip"=>nil, "Country"