 Pet friendly community is smoke free and has a swimming pool, 24 hour fitness center and 24 hour car wash bay. Guarantors welcome.", "LongDescription"=>"Hunter s Chase Apartments in Midlothian, VA 23112 is 20 minutes from downtown Richmond and 30 minutes from Richmond International Airport.  Apartments feature washers/dryers, electric kitchens, breakfast bars, large closets and available covered parking.  Select apartment homes have private entries, optional den, stainless steel appliances, fireplace, extra storage space and private patios/balconies.  Pet friendly community is smoke free and has a swimming pool, 24 hour fitness center, playgrounds, barbecue/picnic area and 24 hour car wash bay.  Located across the street from Swift Creek Reservoir with easy access to I 360 and Route 288. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Hull Street Rd and Commonwealth Centre Pkwy From Powhite Parkway  RT 76 Take 288 South to the Commonwealth Centre Parkway Exit. Stay on Commonwealth Centre Parkway for about 1 4 mile  see Pier 1 Imports  Barnes  amp  Noble on the left . The Hunter s Chase entrance is on the left  past Fresh Market . Follow signs to the Leasing Office. From I 95 Take the 288 North Exit. From 288  take the Hull St 360 Amelia Exit. Get into the left lane  and take a left at the stoplight  see Target  McDonald s on left . Go through the intersection. Hunter s Chase is on the right  50 yards . Follow signs to the Leasing Office.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"covered lot", "Assigned"=>"1", "SpaceFee"=>"30.00", "Spaces"=>nil, "Comment"=>"Covered carport parking options are available for residents."}, {"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot."}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"25.00", "Spaces"=>nil, "Comment"=>"Reserved park