79", "WebSite"=>"http://www.chimneysofcradlerock.com", "Phone"=>{"Number"=>nil}, "Email"=>"038961@aimco.com"}, "Information"=>{"StructureType"=>"unspecified", "UnitCount"=>"198", "YearBuilt"=>"1979", "StartRent"=>"1119.00", "OfficeHour"=>[{"OpenTime"=>"Closed", "CloseTime"=>"Closed", "Day"=>"Su"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"06:00 PM", "Day"=>"M"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"06:00 PM", "Day"=>"T"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"06:00 PM", "Day"=>"W"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"06:00 PM", "Day"=>"Th"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"06:00 PM", "Day"=>"F"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"05:00 PM", "Day"=>"Sa"}], "ShortDescription"=>"Pet friendly apartments in Columbia, MD are soon to be smoke free, with easy access to I 495  amp; I 95. Balcony or Patio, A/C and in home washer and dryer. Options include: fireplace, den, sunroom, skylights, loft. Guarantors welcome.", "LongDescription"=>"Chimneys of Cradlerock in Columbia, Maryland 21045 offers pet friendly living close to Baltimore. Our apartment homes are transitioning to be smoke free and feature a private balcony or patio, A/C, and a fully equipped kitchen with all electric appliances, plus an in home washer and dryer  in 2  and 3 bedroom units . The smoke free transition process will be complete no later than September 1, 2016.  Additional options available include: sunrooms, lofts, vaulted ceilings and wood burning fireplaces. Our community features beautifully landscaped grounds, covered parking, a large picnic area with barbeque grills and playground. We are conveniently located close to I 495, I 95, public transportation, great shopping, family dining, parks and entertainment. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Broken Land Pkwy and Cradlerock Way From Washington  D.C.   Take I 495 to I 95 North. Exit at Route 32 West towards Columbia. Once on Route 32 take the first exit  Broken Land Parkway North. Stay on Broken Land Parkway until you reach Cradlerock Way N.  Cradlerock Way N is the 2nd option  the first one will be South. Cradlerock Way is shaped like a big horseshoe.  Turn right on Cradlerock Way N. Make the first right on Quiet Hours. Turn right into the community and follow signs to the leasing office.From Route 29   Turn right at Exit 18  Broken Land Parkway . At the 2nd light turn left onto Cradlerock Way N. Turn right onto Quiet Hours. Make the first right into the community and follow signs to Leasing office.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"covered lot", "Assigned"=>"1", "SpaceFee"=>"40.00", "Spaces"=>nil, "Comment"=>"Covered carport parking options are available for residents. Residents may rent more than 1 space, subject to availability."}, {"type"=>"surface lot", "Assigned"=>"1", "SpaceFee"=>"10.00", "Spaces"=>nil, "Comment"=>"Parking for residents is available on a first-come, first-served basis in our private parking lot."}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"25.00", "Spaces"=>nil, "Comment"=>"Reserved parking for residents is available in our private parking lot. "}, {"type"=>"street", "Assigned"=>"1", "SpaceFee"=>"0.00", "Spaces"=>nil, "Comment"=>"Additional street parking for guests and residents is available on a first-come, first-served basis."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "GeneralLedger"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "CurrentAccountingPeriod"=>{"year"=>"0", "day"=>"0", "m