, and clubroom. Easy access to I 95, I 495 and I 295. Guarantors welcome.", "LongDescription"=>"Westchester Tower Apartment Homes in College Park, Maryland 20740, a smoke free community that offers pet friendly living close to DC. Our apartment homes feature fully equipped kitchens with pantries, floor to ceiling windows, walk in closets, parquet floors and designer accent wall colors. Some apartment homes have a private patio or balcony, panoramic views and kitchens with GE appliances. Our community amenities include a pool, fitness room, clubroom with wide screen TV, free Wi Fi access, on site recycling, controlled access, PackagePal package delivery system and detached garage parking. We are located in a prime College Park location surrounded by an 1,100 acre National Park. Easy access to I 95, I 495, I 295, the University of Maryland and downtown DC. We are close to shopping, dining, entertainment and recreation. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Paint Branch Pkwy and Kenilworth Ave From Washington  DC  Take New York Avenue to Baltimore Washington Parkway  I 295  to Greenbelt Road. Turn left on Kenilworth Avenue  then left to Westchester Park Drive. Follow the leasing signs past the last high rise building to 6200 Westchester Park Drive.From I 495  Take Exit 23 at Kenilworth Avenue 201 S. Turn left on Westchester Park Drive and follow leasing signs to 6200 Westchester Park Drive. Take Westchester Park Drive all the way to the last high rise building which is 6200 Westchester Park Drive.", "LeaseLength"=>"We offer 7-15 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"50.00", "Spaces"=>nil, "Comment"=>"Reserved garage parking is available in our private parking garage. $50/month for underground parking; $35/month for top-level uncovered parking."}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"45.00", "Spaces"=>nil, "Comment"=>"Reserved parking for residents is available in our pr