tes from downtown Miami and 30 miles from Fort Lauderdale, FL. Smoke free apartments have large closets and private balconies/patios with views of bay, pool, or city of Miami Beach.  Gated, pet friendly community with two swimming pools and one Jacuzzi, fitness center, basketball and beach volleyball courts, poolside tiki bar and car detailing center.  Dry cleaning service, convenience store, 24 hour valet, garage parking and on site recycling.  Located 12 miles from Miami International Airport and easy access to I 395 and I 195 and within walking distance to the beach. Guarantors welcome!", "DrivingDirections"=>"Major Cross Streets  Alton Rd and 15th St. From I 95 Going north or south  exit I 195 eastbound and follow to Alton Road. Veer right onto Alton Road and continue traveling southbound to 15th Street where you ll find Einstein Bagels on the corner. Make a right on 15th Street and continue two blocks ahead where you will see Flamingo South Beach apartment homes. From I 395 Travel east on I 395 until it turns into MacArthur Causeway. Follow across the bay until you reach Alton Road  veer left to make a left turn onto Alton Road. At 15th Street  make a left just past Pollo Tropical Restaurant. Proceed two blocks to Bay Road where you willturn left into the parking entrance on the right at Flamingo South Beach apartment homes.", "LeaseLength"=>"We offer 7-18 month leases. Guarantors welcome.", "Parking"=>[{"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"160.50", "Spaces"=>nil, "Comment"=>"One space can be rented per resident."}, {"type"=>"other", "Assigned"=>"1", "SpaceFee"=>"250.00", "Spaces"=>nil, "Comment"=>"VIP spaces are assigned, covered garage spaces conveniently located near the entrance to the building. Monthly rent includes 7% sales tax."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMt