 welcome!", "DrivingDirections"=>"Evanston Place Apartments  Enjoy 1 hour of free parking in our public attached parking garage when you visit us. Our leasing center is located on 1715 Chicago Avenue through the storefront entry doors  to the left. Major Cross Streets  Chicago Ave and Clark St. From downtown Chicago or the South  take Lake Shore Drive north. Follow signs to Sheridan Road and head north on Sheridan Road to Clark Street. Turn left on Clark Street  then turn into a public garage on the left. From the Western suburbs  take I 94 North to the exit for Dempster East. Continue 3 miles to Chicago Avenue. Turn left on Chicago Avenue  turn right on Church Street  then turn into a public garage on the left. From the Northern suburbs or Wisconsin  take I 294 South to the exit for Dempster East. Continue about 8 miles to Chicago Avenue. Turn left on Chicago Avenue  turn right on Church Street  then turn into a public garage on the left.", "LeaseLength"=>"We offer 7-15 month lease terms. Guarantors welcome.", "Parking"=>[{"type"=>"street", "Assigned"=>"1", "Spaces"=>nil, "Comment"=>"Additional metered street parking for guests and residents is available on a first-come, first-served basis. "}, {"type"=>"garage lot", "Assigned"=>"1", "SpaceFee"=>"70.00", "Spaces"=>nil, "Comment"=>"Covered parking options are available for residents. Prices vary; ask the leasing office for details. Additional metered street parking is available on a first-come, first-served basis."}]}, "Accounting"=>{"LiveDate"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LiveFlag"=>"true", "LastDayBegin"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastDayEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "LastAccMthEnd"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AcctMthEndFlag"=>"none", "LastInvoiceNumber"=>"Conventional", "LastReceiptNumber"=>" ", "CashReserve"=>"0", "EndOfYear"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsReceivable"=>{"year"=>"0", "day"=>"0", "month"=>"0"}, "AccountsPayable"=>{"y